import React from "react";
import { MyContext } from "../context";
import { NavMain } from "../styledComponents/StyledComps";
import { mdiAccountCircleOutline } from '@mdi/js';


export default function NavBar(){
	return(
		<MyContext.Consumer>
		{context => (
			<NavMain>
				<h1>MoMe</h1>
				<Icon path={mdiAccountCircleOutline}
        title="User Profile"
        size={1}
        horizontal
        vertical
        rotate={90}
        color="red"
        spin/>
				<span className="mdi user-circle-outline"></span>


			</NavMain>
		)}
		</MyContext.Consumer>
	)
}
